In pong.rs let's create our first Component , a definition of a paddle. #[derive(PartialEq, Eq)]
enum Side { Left, Right,
} struct Paddle { pub side: Side, pub width: f32, pub height: f32,
} impl Paddle { fn new(side: Side) -> Paddle { Paddle { side: side, width: 1.0, height: 1.0, } }
} "But that just looks like a regular struct!" you might say. And you're right, here's the special sauce: impl Component for Paddle { type Storage = DenseVecStorage<Self>;
} By implementing Component for our Paddle struct, and defining the way we'd like that Component data stored, we can now add the Paddle component to entities in our game. For more on storage types, check out the Specs documentation .

