Now that we have a Paddle component, let's define some paddle entities that include that component and add them to our World . First let's look at our math imports: use amethyst::core::cgmath::Vector3;
use amethyst::core::transform::{GlobalTransform, Transform}; Amethyst uses the cgmath crate under the hood and exposes it for our use. Today we just grabbed the Vector3 type, which is a very good math thing to have. Transform and GlobalTransform are Amethyst ECS components which carry position and orientation information. Transform is relative to a parent if one exists, while GlobalTransform is, well, global. Let's also define some constants for convenience: const PADDLE_HEIGHT: f32 = 0.30;
const PADDLE_WIDTH: f32 = 0.05;
const PADDLE_COLOUR: [f32; 4] = [0.0, 0.0, 1.0, 1.0]; Okay, let's make some entities! We'll define an initialise_paddles function which will create left and right paddle entities and attach Transform components to them to position them in our world. Our canvas goes from -1.0,-1.0 on the bottom left to 1.0,1.0 on the top right, which will make more sense when we define the camera. /// Initialises one paddle on the left, and one paddle on the right.
fn initialise_paddles(world: &mut World) { let mut left_transform = Transform::default(); let mut right_transform = Transform::default(); // Correctly position the paddles. let y = -PADDLE_HEIGHT / 2.0; left_transform.translation = Vector3::new(-1.0, y, 0.0); right_transform.translation = Vector3::new(1.0 - PADDLE_WIDTH, y, 0.0); // Create a left plank entity. world .create_entity() .with(Paddle::new(Side::Left)) .with(GlobalTransform::default()) .with(left_transform) .build(); // Create right plank entity. world .create_entity() .with(Paddle::new(Side::Right)) .with(GlobalTransform::default()) .with(right_transform) .build();
} This is all the information Amethyst needs to track and move the paddles in our virtual world, but we'll need to do some more work to actually draw them.

