Here's a utility function to generate the six vertices of a rectangle (a rectangle in computer graphics is typically drawn with two triangles): fn generate_rectangle_vertices(left: f32, bottom: f32, right: f32, top: f32) -> Vec<PosTex> { vec![ PosTex { position: [left, bottom, 0.], tex_coord: [0.0, 0.0], }, PosTex { position: [right, bottom, 0.0], tex_coord: [1.0, 0.0], }, PosTex { position: [left, top, 0.0], tex_coord: [1.0, 1.0], }, PosTex { position: [right, top, 0.], tex_coord: [1.0, 1.0], }, PosTex { position: [left, top, 0.], tex_coord: [0.0, 1.0], }, PosTex { position: [right, bottom, 0.0], tex_coord: [0.0, 0.0], }, ]
} PosTex is a type defined by amethyst_renderer . It's a vertex format with position and UV texture coordinate attributes. In our rendering pipeline, if you'll recall, we created a DrawFlat::<PosTex> pass, which draws a PosTex mesh. Right now our vertices are simply in a standard Rust Vector . To create a mesh from them we'll write another utility function, which generates a MeshHandle : fn create_mesh(world: &World, vertices: Vec<PosTex>) -> MeshHandle { let loader = world.read_resource::<Loader>(); loader.load_from_data(vertices.into(), (), &world.read_resource())
} The Loader is an asset loader which is defined as a resource (not a Entity , Component , or System , but still a part of our ECS world ). It was created when we built our Application in main.rs , and it can read assets like .obj files, but also it can load_from_data as in our use case. Resources in Specs are a type of data which can be shared between systems, while being independent from entities, in contrast to components, which are attached to specific entities. We'll explore this more later on. The load_from_data function returns a Handle<Mesh> , also known as a MeshHandle . Since Handle implements component, we can attach it to our entity. Once the mesh is fully loaded, a system which asks the handle for the mesh will receive it. If the mesh isn't loaded yet, the handle will return None . In this minimal scenario, the mesh will be available on the next frame. In addition to mesh data, we also need a material to draw our mesh with. We'll use the Amethyst renderer's MaterialDefaults (another resource) and only change the albedo color: /// Creates a solid material of the specified colour.
fn create_colour_material(world: &World, colour: [f32; 4]) -> Material { let mat_defaults = world.read_resource::<MaterialDefaults>(); let loader = world.read_resource::<Loader>(); let albedo = loader.load_from_data(colour.into(), (), &world.read_resource()); Material { albedo, ..mat_defaults.0.clone() }
} Now let's return to inside our initialise_paddles function and actually create this mesh and material. let mesh = create_mesh( world, generate_rectangle_vertices(0.0, 0.0, PADDLE_WIDTH, PADDLE_HEIGHT),
); let material = create_colour_material(world, PADDLE_COLOUR); Now we just add these components to our paddle entities: // Create a left plank entity.
world .create_entity() .with(mesh.clone()) .with(material.clone()) .with(Paddle::new(Side::Left)) .with(GlobalTransform::default()) .with(left_transform) .build(); // Create right plank entity.
world .create_entity() .with(mesh) .with(material) .with(Paddle::new(Side::Right)) .with(GlobalTransform::default()) .with(right_transform) .build(); We're almost done! We just need to create a camera to view all our beautiful graphics (two blue pong paddles) with. fn initialise_camera(world: &mut World) { world .create_entity() .with(Camera::standard_2d()) .build();
} The camera is another entity, with a Camera component. Amethyst's standard_2d camera uses an orthographic projection, and defines a screenspace coordinate system of -1.0,-1.0 in the bottom left and 1.0,1.0 in the top right. If you want to to define your own coordinate system, you can use something like this: fn initialise_camera(world: &mut World) { world.create_entity() .with(Camera::from(Projection::orthographic(0.0, WIDTH, HEIGHT, 0.0))) .with(GlobalTransform(Matrix4::from_translation (Vector3::new(0.0, 0.0, 1.0)).into()) ) .build();
} To use that custom camera you'll need to define WIDTH and HEIGHT constants, and redo the position math in the initialise_paddles function. Now let's add our initialise functions to the on_start function in impl State for Pong . fn on_start(&mut self, world: &mut World) { world.register::<Paddle>(); initialise_paddles(world); initialise_camera(world);
} Okay! We've defined our Paddle component, and created two entities which have Paddle , GlobalTransform , MeshHandle , and Material components. When our game starts, we'll register the Paddle component and then add the left and right paddles to the world, along with a camera. Let's run this and see what happens. On my machine I get a panic that reads: thread 'main' panicked at 'Tried to fetch a resource, but the resource does not exist.
Try adding the resource by inserting it manually or using the `setup` method. It looks like we're missing at least one component registration. In addition to components we define ourselves, Amethyst has a lot of internal systems and components it uses to keep things running. For simplicity, these have been wrapped up into "Bundles" which include related components, systems, and resources. We can add these to our Application using the with_bundle method, and in fact we already have one of these in main.rs : the RenderBundle . As it turns out, the components we're missing are GlobalTransform and Transform , and we can add those with the TransformBundle , which will also add the TransformSystem for working with those components: let mut game = Application::build("./", Pong)? .with_bundle(TransformBundle::new())? //Add this bundle .with_bundle(RenderBundle::new(pipe, Some(config)))? .build()?; Also we'll need to import that structure: use amethyst::core::transform::TransformBundle; Now when we run the game we should get something that looks like this: Step two In the next chapter we'll explore the "S" in ECS and actually get these paddles moving!

