); let input_bundle = InputBundle::<String, String>::new().with_bindings_from_file(binding_path); let game_data = GameDataBuilder::default() .with_bundle(TransformBundle::new())? .with_bundle(RenderBundle::new(pipe, Some(config)))? .with_bundle(input_bundle)? .with(systems::PaddleSystem, "paddle_system", &["input_system"]);
