game.run(); At this point, we're ready to write a system that reads input from the InputHandler , and moves the paddles accordingly. First, we'll create a directory called systems under src to hold all our systems. We'll use a module to collect and export each of our systems to the rest of the application. Here's our mod.rs for src/systems : mod paddle; pub use self::paddle::PaddleSystem; We're finally ready to implement the PaddleSystem : use pong::{Paddle, Side};
use amethyst::ecs::{System, Join, Fetch};
use amethyst::input::InputHandler;
use amethyst::core::transform::components::Transform;
use amethyst::ecs::{ReadStorage, WriteStorage}; pub struct PaddleSystem; impl<'s> System<'s> for PaddleSystem { type SystemData = ( WriteStorage<'s, Transform>, ReadStorage<'s, Paddle>, Read<'s, InputHandler<String, String>>, ); fn run(&mut self, (mut transforms, paddles, input): Self::SystemData) { for paddle in (&paddles).join() { let movement = match paddle.side { Side::Left => input.axis_value("left_paddle"), Side::Right => input.axis_value("right_paddle"), }; if let Some(mv_amount) = movement { if mv_amount != 0.0 { println!("Side {:?} moving {}", paddle.side, mv_amount); } } } }
} Note: We had to make our Paddle and Side public in pong.rs Now lets add this system to our ApplicationBuilder in main.rs : mod systems; // in the run() function
let mut game = Application::build("./", Pong)? .with_bundle(TransformBundle::new())? .with_bundle(RenderBundle::new(pipe, Some(config)))? .with_bundle(input_bundle)? .with(systems::PaddleSystem, "paddle_system", &["input_system"]) .build()?; Let's review what our system does, because there's quite a bit there. We create a unit struct, called PaddleSystem , and implement the System trait for it. The trait specifies the lifetime of the components on which it operates. Inside the implementation, we define the SystemData the system operates on, a tuple of WriteStorage , ReadStorage , and Read . More specifically, the generic types we've used here tell us that the PaddleSystem mutates LocalTransform components, WriteStorage<'s, LocalTransform> , it reads Paddle components, ReadStorage<'s, Paddle> , and also accesses the InputHandler<String, String> resource we created earlier, using the Read structure. It's worth noting an important difference between the objects our system accesses. A system will iterate over entities that contain one of each of the components that it specifies in its SystemData . Going back to our example, the PaddleSystem will ignore any entity that is missing a Paddle , LocalTransform or both.

