So far we've been using the Amethyst supplied GameData struct to handle our System s. This works well for smaller games and demos, but once we start building a larger game, we will quickly realise we need to manipulate the System dispatch based on game State , or we need to pass data between State s that aren't Send + Sync which can't be added to World . The solution to our troubles here is to create a custom GameData structure to house what we need that can not be added to World . In this tutorial we will look at how one could structure a Paused State , which disables the game logic, only leaving a few core systems running that are essential (like rendering, input and UI). Let's start by creating the GameData structure: pub struct CustomGameData<'a, 'b> { core_dispatcher: Dispatcher<'a, 'b>, running_dispatcher: Dispatcher<'a, 'b>,
} We also add a utility function for performing dispatch: impl<'a, 'b> CustomGameData<'a, 'b> { /// Update game data pub fn update(&mut self, world: &World, running: bool) { if running { self.running_dispatcher.dispatch(&world.res); } self.core_dispatcher.dispatch(&world.res); }
} To be able to use this structure with Amethyst s Application we need to create a builder that implements DataInit . This is the only requirement placed on the GameData structure. pub struct CustomGameDataBuilder<'a, 'b> { pub core: DispatcherBuilder<'a, 'b>, pub running: DispatcherBuilder<'a, 'b>,
} impl<'a, 'b> Default for CustomGameDataBuilder<'a, 'b> { fn default() -> Self { CustomGameDataBuilder::new() }
} impl<'a, 'b> CustomGameDataBuilder<'a, 'b> { pub fn new() -> Self { CustomGameDataBuilder { core: DispatcherBuilder::new(), running: DispatcherBuilder::new(), } } pub fn with_base_bundle<B>(mut self, bundle: B) -> Result<Self> where B: SystemBundle<'a, 'b>, { bundle .build(&mut self.core) .map_err(|err| Error::Core(err))?; Ok(self) } pub fn with_running<S>(mut self, system: S, name: &str, dependencies: &[&str]) -> Self where for<'c> S: System<'c> + Send + 'a, { self.running.add(system, name, dependencies); self }
} impl<'a, 'b> DataInit<CustomGameData<'a, 'b>> for CustomGameDataBuilder<'a, 'b> { fn build(self, world: &mut World) -> CustomGameData<'a, 'b> { let pool = world.read_resource::<ThreadPool>().clone(); let mut core_dispatcher = self.core.with_pool(pool.clone()).build(); let mut running_dispatcher = self.running.with_pool(pool.clone()).build(); core_dispatcher.setup(&mut world.res); running_dispatcher.setup(&mut world.res); CustomGameData { core_dispatcher, running_dispatcher } }
} We can now use CustomGameData in place of the provided GameData when building our Application , but first we should create some State s. struct Main;
struct Paused; impl<'a, 'b> State<CustomGameData<'a, 'b>> for Paused { fn on_start(&mut self, data: StateData<CustomGameData>) { create_paused_ui(data.world); } fn handle_event( &mut self, data: StateData<CustomGameData>, event: Event, ) -> Trans<CustomGameData<'a, 'b>> { if is_exit(event.clone()) { Trans::Quit } else if is_pause(event) { delete_paused_ui(data.world); Trans::Pop } else { Trans::None } } fn update(&mut self, data: StateData<CustomGameData>) -> Trans<CustomGameData<'a, 'b>> { data.data.update(&data.world, false); // false to say we should not dispatch running Trans::None }
} impl<'a, 'b> State<CustomGameData<'a, 'b>> for Main { fn on_start(&mut self, data: StateData<CustomGameData>) { initialise(data.world); } fn handle_event( &mut self, _: StateData<CustomGameData>, event: Event, ) -> Trans<CustomGameData<'a, 'b>> { if is_exit(event.clone()) { Trans::Quit } else if is_pause(event) { Trans::Push(Box::new(Paused)) } else { Trans::None } } fn update(&mut self, data: StateData<CustomGameData>) -> Trans<CustomGameData<'a, 'b>> { data.data.update(&data.world, true); // true to say we should dispatch running Trans::None }
} The only thing that remains now is to use our CustomGameDataBuilder when building the Application . let game_data = CustomGameDataBuilder::default() .with_running::<ExampleSystem>(ExampleSystem, "example_system", &[]) .with_base_bundle(TransformBundle::new())? .with_base_bundle(UiBundle::<String, String>::new())? .with_base_bundle(RenderBundle::new(pipeline_builder, Some(display_config)))? .with_base_bundle(InputBundle::<String, String>::new())?; let mut game = Application::new(resources_directory, Main, game_data)?; game.run(); Those are the basics of creating a custom GameData structure. Now get out there and build your game!

